g2:c.PROCEDURE.g2:a.TEXT:
i-write-to-file(explicitly-set-conversion-style:truth-value) = (truth-value, text)

TXT, txt-path-and-file-name: text;
F: class g2-stream;
ee : class error; 
status : truth-value; 
status-text : text; 
begin
    TXT = "Latin-1 Characters:                                                                                                ";

    status, status-text = call prepare-test-file-name-and-directory();
    if status then return status, status-text; 
    txt-path-and-file-name = test-file-name; 

    F = call g2-open-file-for-write(txt-path-and-file-name);       
    if EXPLICITLY-SET-CONVERSION-STYLE then begin
        post "Setting an explicit conversion style";
        conclude that the text-conversion-style of F is TEST-CONVERSION-STYLE-1; 
    end;

    call g2-write-string (F, TXT);
    post "Text [TXT] written to file.";
    call g2-close-file (F);

    return false, "";
end
on error (ee)
    call g2-close-all-files ();
    status-text = "Error in i-write-to-file: [the text of the error-description of ee]";
    delete ee; 
    return true, status-text;
end

{This procedure reads "good" contents of the file and store them to the list. 
Save the kb after using it}
preparation-proc-read-file-and-store-it-to-the-list() 
inn : class g2-stream;
seq : sequence; 
ee : class error;
status-text : text;
begin
    inn = call g2-open-file-for-read(test-file-name);
    seq = call g2-read-bytes-as-sequence(inn, 1024);
    call g2-close-file (inn);
    call grtl-delete-contents(correct-utf-8-bytes);
    insert seq at the beginning of correct-utf-8-bytes;
end
on error (ee) 
    call g2-close-all-files();
    status-text = the text of the error-description of ee;
    delete ee; 
    post "Error: [status-text]";
end

{This procedure reads "good" contents of the file and store them to the list. 
Save the kb after using it}
read-file-and-compare-to-correct-sequence() = (truth-value, text)
inn : class g2-stream;
seq : sequence; 
ee : class error;
comparison-ok : truth-value; 
status-text : text;
begin
    inn = call g2-open-file-for-read(test-file-name);
    seq = call g2-read-bytes-as-sequence(inn, 1024);
    call g2-close-file(inn);
    comparison-ok = call grtl-are-sequences-identical(seq, correct-utf-8-bytes[0]);
    if not (comparison-ok) then
        return true, "File contents is not as expected";
    return false, "";
end
on error (ee) 
    call g2-close-all-files();
    post "Error occured in read-file-and-compare-to-correct-sequence";
    status-text = the text of the error-description of ee;
    delete ee; 
    return true, status-text;
end

do-all-test-inner () = (truth-value, text)
status: truth-value; status-text: text;
begin
    conclude that the text-conversion-style of language-parameters = the symbol none;
    status, status-text = call i-write-to-file(true);
    if status then return status, "Failed to write test file: [status-text]";
    status, status-text = call read-file-and-compare-to-correct-sequence();
    if status then return status, "Preliminary check failed: [status-text]";

    conclude that the text-conversion-style of language-parameters = the symbol test-conversion-style-1;
    status, status-text = call i-write-to-file(false);
    if status then return status, "Failed to write test file (2-nd pass): [status-text]";
    status, status-text = call read-file-and-compare-to-correct-sequence();
    if status then return status, "Test failed: [status-text]";
    return false,"";
end

do-all-test(node: class benchmark-node)
status: truth-value; status-text: text;

begin
    status,status-text = call do-all-test-inner();
    if status then 
        call fail(node, status-text)
    else
        call pass(node); 
end

prepare-test-file-name-and-directory() = (truth-value,text)
filesys : symbol;
path : text;
file-success : truth-value;
exist : truth-value;
begin
    filesys = call g2-type-of-file-system ();
    if filesys = the symbol unix then 
        path = "/g2/src/tests/results/language-parameters--text-conversion-style--test.kb/"
    else 
        path = "c:\g2\src\tests\results\language-parameters--text-conversion-style--test.kb\";
    file-success = call g2-create-directory(path,true);
    if not (file-success) then return true, "Unable to create directory [path]";

    EXIST = call g2-directory-exists (PATH);
    if not (EXIST) then begin
        return true, "The directory [PATH] does not exist!";
    end;

    conclude that test-file-name = "[PATH]test-file-conversion.txt";
    return false,"";
end
